import React from "react";

const Link = (props) => {
  const openInNewTab = props.target === undefined ? "" : `${"_blank"}`;
  return (
    <li className={props.className}>
      <a title={props.title} className={props.className} href={props.href}>
        {props.text} target={openInNewTab}
      </a>
    </li>
  );
};

export default Link;
